import React from "react";
import {
  AppBar,
  Toolbar,
  Box,
  Typography,
  IconButton,
  Drawer,
  List,
  styled,
} from "@mui/material";

const StyledHeader = styled(AppBar)`
  background: #2874;
  height: 55px;
`;
function Header(props) {
  return (
    <div>
      <h1>Header</h1>
      <StyledHeader>
        <Toolbar></Toolbar>
      </StyledHeader>
    </div>
  );
}

export default Header;
